<script>
jQuery(document).ready(function($) {
    
  $('.counter').each(function() {
  var $this = $(this),
      countTo = $this.attr('data-count');
  
  $({ countNum: $this.text()}).animate({
    countNum: countTo
  },

  {

    duration: 9000000000,
    easing:'linear',
    step: function() {
        number = this.countNum;
      $this.text('฿' + addCommas(parseFloat(number).toFixed(2)));
      
    },
    complete: function() {
      $this.text('฿' + addCommas(parseFloat(number).toFixed(2)));

    }

  });  
  
  

});


  
});


function addCommas(nStr)
{
    nStr += '';
    var x = nStr.split('.');
    var x1 = x[0];
    var x2 = x.length > 1 ? '.' + x[1] : '';
    var rgx = /(\d+)(\d{3})/;
    while (rgx.test(x1)) {
        x1 = x1.replace(rgx, '$1' + ',' + '$2');
    }
    return x1 + x2;
}
</script>
